export const MoreProductView = ({ offer }) => {
  return (
    <div class="card-wrapper">
      <div class="img-box-product">
        <div class="hoverable">
          <div class="hoverable__main">
            {" "}
            <img src={offer.imageUrl} />
          </div>
          <span class="hoverable__tooltip">Hover text</span>
        </div>
      </div>
    </div>
  );
};
